import './App.css';

function App() {

  return (
    <div className="App">
        <div>
         <h2>Blog</h2>
        </div>
        <div>

        </div>



    </div>
  );
}

function Card() {
  return (
    <div className="card">
      <h3>글제목: </h3><span>좋아요 ♡</span>
      <p>발행일: </p>
    </div>
  )
}

function CardDetail() {
  return (
    <div className="card">
      <h3>글제목: </h3>
      <p>발행일: </p>
      <p>상세내용: </p>
    </div>
  )
}

export default App;
